import React from 'react'
import '../App.css'
import logo from '../assets/PokeTrumps logo.png';



const HeaderBlock = () => {
    
    return (
        <div className="App">
        <header className= "App-header">
            Hello, welcome to 
        </header>
        <img 
            src={logo} 
            className="App-logo" 
            alt="logo" 
            style={{ width:350, height: 100 }} 
        />
        </div>
        
    )
}


export default HeaderBlock
